import { useState } from 'react';
import './App.css';
import Video from './Video'

function App() {
  const [videos, setVideos] = useState([])

  return (
    <div className="app">
      <div className="app__videos">

        {videos.map(
          (video => {
            <Video 
              url={video.url}
              channel={video.channel}
              description={video.description}
              song={video.song}
              likes={video.likes}
              messages={video.messages}
              shares={video.shares}
            />   
          })
        )}
        <Video 
          url="https://v16-web.tiktok.com/video/tos/useast2a/tos-useast2a-pve-0068/4f03395d2d7f4202aa38e4c4214c0cf2/?a=1988&br=2288&bt=1144&cd=0%7C0%7C1&cr=0&cs=0&cv=1&dr=0&ds=3&er=&expire=1608663699&l=202012221301040101902192103D05D8A1&lr=tiktok_m&mime_type=video_mp4&policy=2&qs=0&rc=M21rNnl3OnM2dTMzOzczM0ApZ2YzNWdkNzw2N2k4ZTs7OGdwMm00L2pnLzJfLS1fMTZzczBfYi4wXzAwNDMvMF42MWE6Yw%3D%3D&signature=82972a749660ab111bf41bdaccd04d41&tk=tt_webid_v2&vl=&vr="
          channel="hasibahmadkh"
          description="this is amazing"
          song="The hak hak"
          likes={123}
